pub enum DaySpec {
    Ordinal(i8),
    Last(Weekday),
    LastOnOrBefore(Weekday, i8),
    FirstOnOrAfter(Weekday, i8),
}

pub enum TimeSpec {
    Hours(i8),
    HoursMinutes(i8, i8),
    HoursMinutesSeconds(i8, i8, i8),
    Zero,
}

pub enum ChangeTime {
    UntilYear(Year),
    UntilMonth(Year, Month),
    UntilDay(Year, Month, DaySpec),
    UntilTime(Year, Month, DaySpec, TimeSpecAndType),
}

pub enum Format {
    Constant(String),
    Alternate {
        standard: String,
        dst: String,
    },
    Placeholder(String),
}

pub enum Error<'line> {
    SurpriseContinuationLine,
    UnknownRuleset(&'line str),
    DuplicateLink(&'line str),
    DuplicateZone,
}
